import React from 'react';
import FetchJobs from '../../services/fetchjobs';

function Jobs() {
    const { jobs, loading, error } = FetchJobs()
        return (
            <div>
             {loading && <h1>loading...</h1>}
             {error && <h1>Error. Try Refreshing.</h1>}   
             <h1>{jobs.length}</h1> 
            </div>
        );
    }

export default Jobs;
